import { connect } from "react-redux"

function Payment (props){
    let setAccess=()=>{
        props.dispatch({
            type:"CHECKOUT",
            payload:4
        }) 
        props.history.push("/checkou/order")
    }
    return(
        <div>
            Currentlly we are accesptiong only cod
            <br/>

            <button onClick={setAccess}  class="btn btn-primary">Next</button>
        </div>
    )
}
export default connect()(Payment)
